.eqv BASE_ADDRESS 0x10008000
.eqv END_ADDRESS 0x10008ffc
.eqv END_PIXEL 65536
.eqv WIDTH 4 # Width of an integer
.eqv PERROW 256
.eqv SLEEP 40

.text
li $t0, BASE_ADDRESS	# stores the base address for display
li $s0, 0x000000	# stores the black colour code
li $s1, 0xdb0c29	# stores the red colour code
li $s2, 0x71b415	# stores the green colour code
li $s3, 0x4a72e9	# stores the blue colour code
li $s4, 0xffd028	# stores the yellow colour code
li $s5, 0xffffff	# stores colour code for colour arrays (white by default)


li $t1, 0		# Counter
li $t2, 0		# Keypress
li $t3, 0		# current position address
move $t4, $t0		# temporary register for base address
li $t5, 30		# starting X position
li $t6, 30		# starting Y position
la $t7, menucolour	# Register for temporary array

main:

	li $v0, 32
	li $a0, SLEEP # Wait
	syscall
	
	menu:
		# Display Main Menu on BitMap Display
		lw $s5, 0($t7)
		sw $s5, 0($t4)
		addi $t7, $t7, 4
		addi $t4, $t4, WIDTH
		addi $t1, $t1, WIDTH
		blt $t1, END_PIXEL, menu
		j continue
	
	continue:
		li $t9, 0xffff0000 # hex code for keyboard
		lw $t8, 0($t9)
		beq $t8, 1, keypress_happened

	keypress_happened:
		move $t4, $t0
		li $t1, 0
		lw $t2, 4($t9) # this assumes $t9 is set to 0xfff0000 from before
		beq $t2, 0x65, END # Hex code of 'e' is 0x65, set to exit and call $v0 10
		beq $t2, 0x71, quit # Hex code of 'q' is 0x71, set to quit
		beq $t2, 0x72, restart # Hex code of 'r' is 0x72, set to restart
		beq $t2, 0x73, restart # Hex code of 's' is 0x72, set to restart
		j keypress_happened
	
	restart:
		jal game
		j keypress_happened
	
	quit:
		# Quit to Main Menu
		# Display Main Menu on BitMap Display
		la $t7, menucolour # set $t7 to address of menucolour
		quitloop:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, quitloop

game:
	
	address:
		# adress(x,y) = address(t5,t6) = (t6 * PERROW + t5)*4
		li $t8, PERROW
		mult $t8, $t6
		mflo $t3
		add $t3, $t3, $t5
		li $t8, WIDTH
		mult $t3, $t8
		mflo $t3
	
	
	# Display Level 1 Stage on BitMap Display
	stage1:
		la $t7, level1
		stageloop1:
			lw $s5, 0($t7)
			sw $s5, 0($t4)
			addi $t7, $t7, 4
			addi $t4, $t4, WIDTH
			addi $t1, $t1, WIDTH
			blt $t1, END_PIXEL, stageloop1
		j character
	
	character:
		sw $s0, 0($t3)
		addi $t3, $t3, 4
		sw $s0, 0($t3)
		addi $t3, $t3, 256
		sw $s0, 0($t3)
		addi $t3, $t3, 4
		sw $s0, 0($t3)
		j keypress_happened
		
	move_left:
	
	cover:

END:
	# Display Black Screen on BitMap Display
	sw $s0, 0($t4)
	addi $t4, $t4, WIDTH
	addi $t1, $t1, WIDTH
	blt $t1, END_PIXEL, END

	li $v0, 4
	la $a0, result
	syscall
		
	li $v0, 10 # terminate the program gracefully
	syscall

